/*Table structure for table `adm_session` */

CREATE TABLE `adm_session` (
  `id` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `title` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `year` int(4) NOT NULL,
  `cycle` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(5) NOT NULL DEFAULT '0',
  `url` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `start_date_time` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `start_date` bigint(15) DEFAULT NULL COMMENT 'time in unix time stamp',
  `end_date` bigint(15) DEFAULT NULL COMMENT 'time in unix time stamp',
  `end_date_time` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `prefix` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `verify` tinyint(3) DEFAULT '0',
  `created_at` int(15) DEFAULT NULL,
  `updated_at` int(15) NOT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `title` (`title`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `adm_session` */

/*Table structure for table `adm_state_district` */

CREATE TABLE `adm_state_district` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `name` varchar(120) COLLATE utf8mb4_unicode_ci NOT NULL,
  `state_id` int(11) NOT NULL,
  `status` tinyint(3) DEFAULT '0',
  `updated_at` int(11) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `ip` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`,`state_id`),
  UNIQUE KEY `name` (`name`,`state_id`)
) ENGINE=InnoDB AUTO_INCREMENT=669 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

