/*Table structure for table `admin_login` */

CREATE TABLE `admin_login` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `mobile` varchar(15) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `collegeId` int(11) unsigned DEFAULT NULL,
  `depId` int(11) unsigned DEFAULT NULL,
  `auth_key` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `password_hash` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `password_reset_token` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `role` int(10) unsigned DEFAULT NULL COMMENT '1=>Department,2=>Guest',
  `status` smallint(6) NOT NULL DEFAULT '10',
  `email_verified` smallint(5) unsigned NOT NULL DEFAULT '1',
  `verifyMobile` tinyint(4) DEFAULT '0',
  `ip` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `lastLogin` datetime DEFAULT NULL,
  `firstLogin` datetime DEFAULT NULL,
  `reset` tinyint(3) unsigned DEFAULT '0',
  `relationship` int(11) DEFAULT NULL,
  `third_party_counsellor_type` tinyint(4) DEFAULT NULL,
  `firm_name` varchar(255) DEFAULT NULL,
  `firm_address` varchar(255) DEFAULT NULL,
  `firm_gst_number` varchar(255) DEFAULT NULL,
  `firm_pan_number` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`,`username`) USING BTREE,
  KEY `depId` (`depId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

