/*Table structure for table `cas` */

CREATE TABLE `cas` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `employee_id` int(11) NOT NULL,
  `cas_scheme` int(11) NOT NULL,
  `department` int(11) NOT NULL,
  `other_department` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `referenceNo` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `salutation` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `first_name` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `middle_name` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_name` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `designation` int(11) NOT NULL,
  `other_designation` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `promotion` int(11) NOT NULL,
  `email` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `pay_scale` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `filled_app_scan_copy` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `criteria_selected` text COLLATE utf8_unicode_ci,
  `date_of_eligibility` date DEFAULT NULL,
  `date_of_eligibility_by_establishment_branch` date DEFAULT NULL,
  `remarks` text COLLATE utf8_unicode_ci,
  `status` int(11) DEFAULT '1',
  `submit_date` datetime DEFAULT NULL,
  `created_at` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updated_at` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
