/*Table structure for table `core_college_course_list` */

CREATE TABLE `core_college_course_list` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `ou_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `ou_id` int(10) unsigned NOT NULL,
  `course_id` int(10) unsigned NOT NULL,
  `course_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `course_type` tinyint(5) NOT NULL,
  `seat_total` int(10) unsigned DEFAULT '0',
  `seat_supnum` int(10) unsigned DEFAULT '0',
  `seat_total_all` int(10) unsigned DEFAULT '0',
  `status` tinyint(5) NOT NULL DEFAULT '1',
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `created_at` int(11) unsigned DEFAULT NULL,
  `updated_at` int(11) unsigned DEFAULT NULL,
  `updated` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ip` varchar(32) CHARACTER SET latin1 DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `college_code_2` (`ou_id`,`course_id`),
  KEY `course_id` (`ou_id`),
  KEY `course_id_2` (`course_id`),
  KEY `ou_name` (`ou_name`),
  KEY `course_name` (`course_name`),
  CONSTRAINT `core_college_course_list_ibfk_1` FOREIGN KEY (`ou_id`) REFERENCES `core_administrative_unit` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_college_course_list_ibfk_2` FOREIGN KEY (`course_id`) REFERENCES `core_course_list` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_college_course_list_ibfk_3` FOREIGN KEY (`ou_name`) REFERENCES `core_administrative_unit` (`name`) ON UPDATE CASCADE,
  CONSTRAINT `core_college_course_list_ibfk_4` FOREIGN KEY (`course_name`) REFERENCES `core_course_list` (`title`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `core_college_course_list` */

/*Table structure for table `core_college_course_seats` */

CREATE TABLE `core_college_course_seats` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `ou_id` int(11) unsigned NOT NULL,
  `course_id` int(11) unsigned NOT NULL,
  `category` varchar(50) NOT NULL,
  `total_seats` int(11) unsigned NOT NULL DEFAULT '0',
  `admission_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `allocated_seats` int(11) unsigned DEFAULT '0',
  `vacant_seats` int(11) unsigned DEFAULT '0',
  `percentage` decimal(10,2) DEFAULT '0.00',
  `seat_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '1 => Supernumerary, 0 => Non-supernumerary',
  `minimum_eligibility_percentage` decimal(10,2) DEFAULT '33.00',
  `status` tinyint(4) DEFAULT '0',
  `visible` tinyint(4) DEFAULT '0',
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  `updated` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ip` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `college_id` (`ou_id`,`course_id`,`category`),
  KEY `course_id` (`course_id`),
  KEY `course_college_seats_ibfk_1` (`ou_id`),
  CONSTRAINT `core_college_course_seats_ibfk_1` FOREIGN KEY (`ou_id`) REFERENCES `core_administrative_unit` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_college_course_seats_ibfk_2` FOREIGN KEY (`course_id`) REFERENCES `core_course_list` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `core_college_course_seats` */

