  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `course_id` (`course_id`,`eligibility_id`,`category`),
  KEY `eligibility_id` (`eligibility_id`),
  KEY `category` (`category`),
  CONSTRAINT `core_course_admission_percentage_ibfk_1` FOREIGN KEY (`course_id`) REFERENCES `core_course_list` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_course_admission_percentage_ibfk_2` FOREIGN KEY (`eligibility_id`) REFERENCES `core_course_eligibility_criteria` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_course_admission_percentage_ibfk_3` FOREIGN KEY (`category`) REFERENCES `core_admission_category` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

