/*Table structure for table `core_course_list` */

CREATE TABLE `core_course_list` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `short_code` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cucet_code` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `subject` varchar(128) COLLATE utf8_unicode_ci NOT NULL COMMENT 'physic,cemistry,elect',
  `course_type` tinyint(11) unsigned NOT NULL COMMENT 'pg/ug/diploma,crtificate',
  `program` tinyint(4) unsigned NOT NULL COMMENT 'Bsc(H),Bsc(Program),B.Sc(Applied),bcom,ma,msc',
  `duration_months` int(11) unsigned NOT NULL COMMENT 'numbers of months',
  `stream` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT 'science,com,arts/humanities',
  `department` int(11) unsigned DEFAULT NULL,
  `faculty` int(11) unsigned DEFAULT NULL,
  `fee_mode` tinyint(3) unsigned DEFAULT NULL COMMENT 'Annual/semester',
  `visible` tinyint(4) unsigned DEFAULT '1' COMMENT 'public or private',
  `status` tinyint(4) unsigned DEFAULT '1' COMMENT 'enabled/disabled',
  `college_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `university_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `evaluation_criteria` tinyint(3) unsigned DEFAULT NULL COMMENT 'cgpa,percentage,credit,grade',
  `self_financed` tinyint(3) unsigned DEFAULT '0',
  `logo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `upload` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `url` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `summary` text COLLATE utf8_unicode_ci,
  `description` text COLLATE utf8_unicode_ci,
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`subject`,`stream`,`course_type`,`program`),
  UNIQUE KEY `title` (`title`),
  KEY `program` (`program`),
  KEY `course_type` (`course_type`),
  KEY `department` (`department`),
  KEY `stream` (`stream`),
  KEY `course_list_ibfk_5` (`evaluation_criteria`),
  CONSTRAINT `core_course_list_ibfk_1` FOREIGN KEY (`course_type`) REFERENCES `core_course_type` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_course_list_ibfk_2` FOREIGN KEY (`program`) REFERENCES `core_course_program` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `core_course_list_ibfk_3` FOREIGN KEY (`stream`) REFERENCES `core_course_stream` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `core_course_list` */

