insert  into `core_declaration`(`id`,`module`,`name`,`description`,`status`,`update_disabled`,`created_by`,`created_at`,`updated_by`,`updated_at`,`ip`) values (3,'payroll','tax_declaration','Sub: Regarding Deduction of Income Tax at source from salary during the Financial Year 2020-21  Assessment Year 2020-21).\r\n\r\n<ul>\r\n<li>As per the provisions of Income Tax Act, the Salary Disbursing Authority is liable to deduct income tax in equal monthly installments at the rates in force for the current financial year on estimated salary for the entire year after allowing admissible deductions.\r\n</li>\r\n<li>Salary Disbursing Authority is also required to file Quarterly statement of the TDS in Form No. 24Q. The Quarterly statement of TDS requires details of all tax deductions with name and Permanent Account Number (PAN) of the persons in respect of whom tax was deducted. Therefore, PAN may be mentioned correctly in the enclosed performa. Those who have not been allotted PAN so far, may obtain the PAN. The credit for TDS would be allowed by the Income Tax Department only on the basis of the Quarterly Statement of TDS uploaded by the Salary Disbursing Authority. It may also be mentioned that quoting incorrect PAN may attract initiation of Penalty as per the provisions of the Income Tax Act.\r\n</li>\r\n<li>The rates of income tax applicable for the financial year 2020-21 have been indicated in the attached Annexure. Accordingly, the income tax is to be calculated on estimated income under the head \"Salary\" and any other income wish to be reported in the enclosed Performa. Duly filled-in Income Declaration Form may be returned to the Salary Section along with details of savings/ rebate to be claimed for computation of Income Tax.\r\n</li>\r\n<li>The staff members who have been drawing House Rent Allowance and residing in a rented house can claim HRA rebate on furnishing proof of monthly Rent Receipt along with the details like name, full address, and photocopy of PAN Card of the House Owner. HRA rebate will not be given on the basis of undertaking. However, LIC, tuition fee and other saving(s) should be submitted with \r\nproofs latest by 31st December, 2020.  Accordingly balance tax payable would be deducted from the salary for the month of January, 2021 & February, 2021. Similarly, for claiming Tax Rebate on interest accrued on the House Building Advance and interest paid during the financial year on Educational Loan, declaration in Form 12-C (available in the Salary Section) along with documentary proof of completion possession of the house and Bank statement for Educational Loan may be submitted.\r\n</li>    \r\n<li>The attached Annexure, duly filled-in, may please be submitted in the Salary Section on or before 20th August, 2020. At present, income tax is being deducted on the basis of annual estimated salary and also considering the savings available on record.</li>\r\n<li>As per the statutory provisions tax deducted till now, on the basis of annual estimated salary, has already been deducted and deposited in the Govt. Account. Quarterly TDS return for the Quarter ending on June 2020 has already been uploaded with the Income Tax Department.</li>\r\n</ul>',1,1,214,1568726175,214,1576660458,'10.107.102.184');

