/*Table structure for table `core_ou_structure` */

CREATE TABLE `core_ou_structure` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ou_id` int(10) unsigned NOT NULL,
  `designation_id` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `parent_id` int(10) unsigned NOT NULL,
  `is_parent` tinyint(4) DEFAULT '0',
  `unique_identification` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `depth` int(11) DEFAULT NULL,
  `path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `order` int(11) DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL,
  `update_disabled` tinyint(4) DEFAULT '0',
  `created_at` int(10) unsigned DEFAULT NULL,
  `updated_at` int(10) unsigned DEFAULT NULL,
  `created_by` int(10) unsigned DEFAULT NULL,
  `updated_by` int(10) unsigned DEFAULT NULL,
  `updated` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `ip` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ou_id` (`ou_id`,`designation_id`,`unique_identification`,`parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `core_ou_structure` */

/*Table structure for table `core_program_admission_percentage` */

CREATE TABLE `core_program_admission_percentage` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `course_id` int(10) unsigned NOT NULL,
  `eligibility_id` int(10) unsigned NOT NULL,
  `category` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `percentage` decimal(10,2) DEFAULT '0.00',
  `created_at` int(10) unsigned DEFAULT NULL,
  `updated_at` int(10) unsigned DEFAULT NULL,
  `created_by` int(10) unsigned DEFAULT NULL,
  `updated_by` int(10) unsigned DEFAULT NULL,
  `ip` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `course_id` (`course_id`,`eligibility_id`,`category`),
  KEY `eligibility_id` (`eligibility_id`),
  KEY `core_program_admission_percentage_ibfk_3` (`category`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `core_program_admission_percentage` */

/*Table structure for table `core_program_discipline` */

CREATE TABLE `core_program_discipline` (
  `id` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `title` varchar(150) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `options_for_diploma` tinyint(4) DEFAULT NULL,
  `options_for_certificate` tinyint(4) DEFAULT NULL,
  `update_disabled` tinyint(3) unsigned DEFAULT '0',
  `status` tinyint(3) unsigned DEFAULT '1',
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `created_at` int(10) unsigned DEFAULT NULL,
  `updated_at` int(10) unsigned DEFAULT NULL,
  `created_by` int(10) unsigned DEFAULT NULL,
  `updated_by` int(10) unsigned DEFAULT NULL,
  `ip` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `title` (`title`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

