/*Table structure for table `core_program_list` */

CREATE TABLE `core_program_list` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `short_code` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cucet_code` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `subject` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'physic,cemistry,elect',
  `program_type` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Bsc(H),Bsc(Program),B.Sc(Applied),bcom,ma,msc',
  `duration_months` int(11) unsigned NOT NULL COMMENT 'numbers of months',
  `stream` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT 'science,com,arts/humanities',
  `medium` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `first_year_fee` decimal(10,2) DEFAULT '0.00',
  `second_year_fee` decimal(10,2) DEFAULT '0.00',
  `third_year_fee` decimal(10,2) DEFAULT '0.00',
  `fourth_year_fee` decimal(10,2) DEFAULT '0.00',
  `fith_year_fee` decimal(10,2) DEFAULT '0.00',
  `total_credit` decimal(10,2) DEFAULT '0.00',
  `semester_annual` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `semester_i_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_ii_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_iii_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_iv_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_v_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_vi_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_vii_exam_fee` decimal(10,2) DEFAULT '0.00',
  `semester_viii_exam_fee` decimal(10,2) DEFAULT '0.00',
  `annual_i_exam_fee` decimal(10,2) DEFAULT '0.00',
  `annual_ii_exam_fee` decimal(10,2) DEFAULT '0.00',
  `annual_iii_exam_fee` decimal(10,2) DEFAULT '0.00',
  `annual_iv_exam_fee` decimal(10,2) DEFAULT '0.00',
  `convocation_fee` decimal(10,2) DEFAULT '0.00',
  `department` int(10) unsigned DEFAULT NULL,
  `faculty` int(10) unsigned DEFAULT NULL,
  `fee_mode` tinyint(3) unsigned DEFAULT NULL COMMENT 'Annual/semester',
  `status` tinyint(4) unsigned DEFAULT '1' COMMENT 'enabled/disabled',
  `college_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `university_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `evaluation_criteria` tinyint(3) unsigned DEFAULT NULL COMMENT 'cgpa,percentage,credit,grade',
  `self_financed` tinyint(3) unsigned DEFAULT '0',
  `logo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `upload` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `url` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `summary` text COLLATE utf8_unicode_ci,
  `description` text COLLATE utf8_unicode_ci,
  `created_at` int(10) unsigned DEFAULT NULL,
  `updated_at` int(10) unsigned DEFAULT NULL,
  `created_by` int(10) unsigned DEFAULT NULL,
  `updated_by` int(10) unsigned DEFAULT NULL,
  `ip` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `title` (`title`),
  UNIQUE KEY `name` (`program_type`,`title`),
  KEY `program` (`program_type`),
  KEY `department` (`department`),
  KEY `stream` (`stream`),
  KEY `course_list_ibfk_5` (`evaluation_criteria`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

