  `otp_generation_time` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `forced_password_reset` tinyint(4) DEFAULT NULL,
  `two_factor_authentication` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=215 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

