/*Table structure for table `core_user_assignments` */

CREATE TABLE `core_user_assignments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ou` int(11) unsigned NOT NULL COMMENT 'department,faculty etc',
  `designation` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_id` int(11) unsigned NOT NULL COMMENT 'employee unique id from employee table',
  `application_id` int(11) DEFAULT NULL COMMENT 'application to redirect',
  `appointment_date_time` datetime DEFAULT NULL,
  `promotion_scheme` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `promotion_date_time` datetime DEFAULT NULL,
  `appointment_type` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `joining_date` datetime DEFAULT NULL,
  `relieving_date` datetime DEFAULT NULL COMMENT 'last date',
  `status` tinyint(4) DEFAULT NULL COMMENT 'active or inactive current',
  `login_status` tinyint(4) DEFAULT NULL COMMENT 'login allowd on this',
  `notification_no` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'file number',
  `notification_date` date DEFAULT NULL,
  `substantive_post` tinyint(4) DEFAULT '0' COMMENT '0 no, 1 yes',
  `reporting_to_ou` int(11) DEFAULT NULL,
  `reporting_to_designation` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` int(10) unsigned DEFAULT NULL,
  `updated_at` int(10) unsigned DEFAULT NULL,
  `created_by` int(10) unsigned DEFAULT NULL,
  `updated_by` int(10) unsigned DEFAULT NULL,
  `ip` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ou` (`ou`,`user_id`,`designation`,`application_id`),
  KEY `designation` (`designation`),
  KEY `user_id` (`user_id`),
  KEY `application_id` (`application_id`),
  CONSTRAINT `core_user_assignments_ibfk_3` FOREIGN KEY (`user_id`) REFERENCES `ems_profile` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

