insert  into `ems_email_templates`(`id`,`name`,`type`,`subject`,`msg_body`,`created_at`,`updated_at`,`created_by`,`updated_by`,`ip`,`status`) values (4,'Registration with Forced Password Reset',4,'You have a new Samarth Account','<p>Hello {full_name},</p>\n <p>You have a new Samarth Account with the {institute_name}.</p>\n <p>Sign in to your Samarth Account to access the Samarth services your organization provides.</p>\n <p><strong>Your username:</strong> {username}</p>\n <p><strong>Your email: </strong>{email}</p>\n <p><strong>Password:</strong>&nbsp;Click&nbsp;<strong>Sign in</strong>&nbsp;below to set your password and sign in.</p>\n <div>\n <table role=\"presentation\">\n <tbody>\n <tr>\n <td>\n <table>\n <tbody>\n <tr>\n <td><a href=\"{first_login_link}\" target=\"_blank\" >Sign in</a></td>\n </tr>\n </tbody>\n </table>\n </td>\n </tr>\n </tbody>\n </table>\n </div>\n <p>&nbsp;</p>\n <p>Regards,</p>\n <p>Samarth Team</p>',1617956264,1617956264,214,214,'::1',1);
