  `sort_order` tinyint(4) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `endowment_contribution_area` */

/*Table structure for table `endowment_log` */

CREATE TABLE `endowment_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `referenceNo` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `data` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ip` varchar(132) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `endowment_log` */

/*Table structure for table `endowment_pay_temp_data` */

CREATE TABLE `endowment_pay_temp_data` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `data` varchar(1500) DEFAULT NULL,
  `formNo` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `endowment_pay_temp_data` */

/*Table structure for table `endowment_pay_trans_sent` */

CREATE TABLE `endowment_pay_trans_sent` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `mId` varchar(50) CHARACTER SET latin1 NOT NULL,
  `formId` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `customerId` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `txnId` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `banktxnNumber` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `email` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `mobile` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `response` varchar(10) CHARACTER SET latin1 DEFAULT NULL,
  `responseDate` datetime DEFAULT NULL,
  `paid` tinyint(4) DEFAULT NULL,
  `amount` decimal(13,2) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `responseFrom` tinyint(4) DEFAULT NULL COMMENT 'browser/s2s/status/manual',
  `status` tinyint(4) DEFAULT NULL,
  `extra1` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `dsm_trans_sent_ibfk_1` (`formId`),
  KEY `formId` (`formId`,`customerId`,`email`,`mobile`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `endowment_pay_trans_sent` */

/*Table structure for table `endowment_payment_gateway` */

CREATE TABLE `endowment_payment_gateway` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `name` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `account_name` varchar(197) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mid` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `code` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `key` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `website` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `atom_request_hash_key` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `atom_response_hash_key` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `atom_request_encryption_key` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `atom_response_encryption_key` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `atom_request_salt` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `atom_response_salt` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `transaction_url` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status_query_url` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `refund_url` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `return_url` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `industry` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `channel` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `theme` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `logo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currency` varchar(20) COLLATE utf8_unicode_ci DEFAULT 'INR',
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `visible` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `endowment_payment_gateway` */

/*Table structure for table `endowment_payment_purpose` */

CREATE TABLE `endowment_payment_purpose` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `sort_order` tinyint(4) DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL COMMENT '0=>Inactive,1=>Active',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `institution_id` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `endowment_payment_purpose` */

/*Table structure for table `endowment_payment_user` */

CREATE TABLE `endowment_payment_user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `referenceNo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_indian` tinyint(4) NOT NULL,
  `user_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `user_type_other` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_option` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `payment_option_other` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `property_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `property_type_other` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `salutation` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `last_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `contact_no` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mobile_no` bigint(20) unsigned NOT NULL,
  `pan_no` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `department_college_name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `course_name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currently_working_place` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `current_designation` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address_line_1` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `address_line_2` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `city` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `state` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `postal_pin` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `country` int(11) NOT NULL,
  `contribution_area` text COLLATE utf8_unicode_ci,
  `contribution_area_other` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `comments` text COLLATE utf8_unicode_ci,
  `fee_amount` decimal(15,2) DEFAULT NULL,
  `login_access_code` int(10) unsigned DEFAULT NULL,
  `image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `publishing_consent` tinyint(4) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `order_id` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customer_id` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `transaction_number` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bank_transaction_number` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `paid_amount` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `update_by_status_query` tinyint(4) DEFAULT '0' COMMENT '0=>no,1=>yes',
  `payment_date` timestamp NULL DEFAULT NULL,
  `ip` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0=>not paid,1=>paid',
  PRIMARY KEY (`id`),
  KEY `payment_user_ibfk_1` (`payment_option`),
  KEY `user_type` (`user_type`),
  KEY `referenceNo` (`referenceNo`,`email_id`,`mobile_no`,`order_id`,`customer_id`,`paid_amount`,`update_by_status_query`),
  KEY `property_type` (`property_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `endowment_payment_user` */

