/*Table structure for table `endowment_zpay_trans_sent` */

CREATE TABLE `endowment_zpay_trans_sent` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `transaction_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ONLINE/CASH/DRAFT',
  `product_info` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'fee/admission/latefee',
  `product_payment_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'sub category of payment_info',
  `consumer_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'student/employee',
  `consumer_id` bigint(20) DEFAULT '0' COMMENT 'student_id/employee_id',
  `user_id` int(11) DEFAULT '0' COMMENT 'user login table id',
  `firstname` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `service_reference_no` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'id of table requesting payment',
  `referenceNo` bigint(20) DEFAULT NULL COMMENT 'to be shown to consumer eg formNo/ enrolment_no',
  `pg_identifier` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'payment gateway id',
  `mid` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `mobile` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `response` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT 'DRAFT',
  `response_sub_state` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'unmappedstatus',
  `paid` tinyint(4) DEFAULT '0',
  `final_status` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT 'DRAFT' COMMENT 'paid,refund',
  `amount_sent` decimal(10,2) DEFAULT '0.00',
  `amount_sent_currency` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `amount_received` decimal(10,2) DEFAULT '0.00',
  `amount_received_currency` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `type` tinyint(4) DEFAULT '0' COMMENT 'payment 9 or refund=1',
  `pg_transaction_id` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pg_transaction_date` datetime DEFAULT NULL,
  `update_mode` char(3) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'S2S,etc',
  `pg_transaction_date_raw` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `update_time_in_system` datetime DEFAULT NULL,
  `created_at` int(11) DEFAULT '1',
  `updated_at` int(11) DEFAULT '1',
  `created_by` int(11) DEFAULT '1',
  `created_by_name` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `updated` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `draft_bank_name` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `draft_date` date DEFAULT NULL,
  `draft_number` varbinary(195) DEFAULT NULL,
  `group_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `group_name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `extra1` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `extra2` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `verified` tinyint(4) DEFAULT '0',
  `verified_date` datetime DEFAULT NULL,
  `verified_mode` char(3) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `double_payment` tinyint(4) DEFAULT '0',
  `refund_initiated` tinyint(4) DEFAULT '0' COMMENT 'yes/no',
  `refund_status` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `refund_reference_no` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'from refund table',
  `refund_amount` decimal(10,2) DEFAULT NULL,
  `refund_date` int(11) DEFAULT NULL,
  `udf1` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `udf2` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `udf3` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `udf4` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `udf5` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `udf6` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `service_object` varchar(195) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `remarks` text COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`id`),
  KEY `userId` (`user_id`),
  KEY `transaction_type` (`transaction_type`,`response`),
  KEY `product_info` (`product_info`,`product_payment_type`,`consumer_type`,`consumer_id`,`service_reference_no`,`pg_identifier`),
  FULLTEXT KEY `formNo` (`service_reference_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

