/*Table structure for table `placement_apply` */

CREATE TABLE `placement_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `training_placement_info_id` int(11) NOT NULL,
  `company_profile_id` int(11) DEFAULT NULL,
  `applicant_id` varchar(11) COLLATE utf8mb4_unicode_ci NOT NULL,
  `applicant_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `student_bio` text COLLATE utf8mb4_unicode_ci,
  `ou_id` bigint(20) NOT NULL,
  `applicant_mobile` bigint(10) NOT NULL,
  `applicant_email` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `percentage` float DEFAULT NULL,
  `hireStatus` int(11) DEFAULT NULL,
  `hireDate` datetime DEFAULT NULL,
  `hireRemark` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `hireMarkedBy` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `hire_designation` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `hire_location` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `hire_package` int(11) DEFAULT NULL,
  `application_status` tinyint(5) NOT NULL DEFAULT '1',
  `company_status` tinyint(4) DEFAULT NULL,
  `reject_remarks` text COLLATE utf8mb4_unicode_ci,
  `reject_remarks_company` text COLLATE utf8mb4_unicode_ci,
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `training_placement_info_id` (`training_placement_info_id`,`applicant_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

