  `procedure_of_procurement` int(11) DEFAULT NULL,
  `other_procedure_of_procurement` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `details_of_stock` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
