  `bill_passed_amount` decimal(15,2) DEFAULT NULL,
  `departmental_diary_no` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `departmental_diary_date` date DEFAULT NULL,
  `remarks` text COLLATE utf8_unicode_ci,
  `objection_status` tinyint(4) DEFAULT '0',
  `objection_remark` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_gst_required` tinyint(4) DEFAULT '1',
  `created_at` datetime DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `ip` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `department_2` (`department`,`purchase_number`,`date_of_purchase`,`quantity_of_items`,`total_amount`),
  KEY `user_id` (`user_id`),
  KEY `department` (`department`),
  KEY `referenceNo` (`referenceNo`),
  KEY `vendor_name` (`vendor_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

